import React, { FunctionComponent, useState, useEffect } from 'react';
import Skin from "../../models/skin";
/* import SkinCard from '../skin-card';
import { Link } from 'react-router-dom'; */

type Props = {
    SkinsIn: Array<Skin>
};

const SkinListInput: FunctionComponent<Props> = ({ SkinsIn }) => {


    const [skins, setSkins] = useState(SkinsIn);

    useEffect(() => {
        setSkins(SkinsIn);
    }, [SkinsIn]);
    return (

        <div>
            <h2>okkk</h2>
            {skins.map(skin => console.log(skin))}
        </div>
    );
}

export default SkinListInput;
